import React, {Component} from 'react';
import SeoPrice from "./SeoPrice";

class Seopay extends Component {
    render() {
        return (
            <div className="container-fluid" data-aos="flip-right">
                <div className="container">
                    <SeoPrice />
                </div>
            </div>
        );
    }
}

export default Seopay;
